import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

const linksArray = ["Option1", "Option2", "Option3", "Option4"];
function App() {
  return (
    <>
      {/* <Navbar links={linksArray} /> */}
      {/* <Articles/> */}
      {/* <Signup/> */}
      {/* <Login /> */}
      <Router>
      {/* Other components */}
      <Routes>
        <Route path="/Login" element={<Login />} />
        <Route path="/Signup" element={<Signup />} />
        <Route path="/navbar" element={<Navbar links/>} />
        {/* Other routes */}
      </Routes>
    </Router>

    </>
  );
}

export default App;
